									</xs:sequence>
								</xs:complexType>
							</xs:element>
						</xs:sequence>
					</xs:complexType>
				</xs:element>
				<xs:element name="ContactPerson" minOccurs="0">
					<xs:complexType>
						<xs:sequence>
							<xs:element name="ContactName" type="ldt_Text_1023" minOccurs="1" />
