            <xsl:call-template name="booleanCheckboxToString">
                <xsl:with-param name="boolValue" select="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:ThereIsNoOtherProceedings" />
            </xsl:call-template>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:ThereIsNoOtherProceedingsDetail">
            <xsl:call-template name="SekciaPodrobnosti_2"></xsl:call-template>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:InAnotherPartOfTheEnforcementProceedings/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
            <xsl:text>Časť nároku podľa exekučného titulu je vymáhaná v inom exekučnom konaní alebo obdobnom vykonávacom konaní:</xsl:text>
            <xsl:call-template name="booleanCheckboxToString">
                <xsl:with-param name="boolValue" select="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:InAnotherPartOfTheEnforcementProceedings" />
            </xsl:call-template>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:InAnotherPartOfTheEnforcementProceedingsDetail">
            <xsl:call-template name="SekciaPodrobnosti_3"></xsl:call-template>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:ClaimFromOldExecution/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
            <xsl:text>Návrhom sa uplatňuje nárok zo starej exekúcie:</xsl:text>
            <xsl:call-template name="booleanCheckboxToString">
                <xsl:with-param name="boolValue" select="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:ClaimFromOldExecution" />
            </xsl:call-template>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:ClaimFromOldExecutionDetail">
            <xsl:call-template name="SekciaPodrobnosti_8"></xsl:call-template>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:EnforcementOfClaimsByThirdParties/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
            <xsl:text>Oprávnený je oprávnený vyžadovať splnenie vymáhaného nároku zároveň od iných osôb:</xsl:text>
            <xsl:call-template name="booleanCheckboxToString">
                <xsl:with-param name="boolValue" select="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:EnforcementOfClaimsByThirdParties" />
            </xsl:call-template>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:EnforcementOfClaimsByThirdPartiesDetail">
            <xsl:call-template name="SekciaPodrobnosti_4"></xsl:call-template>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:IsLegalSuccessor/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
            <xsl:text>Oprávnený/povinný je právnym nástupcom osoby uvedenej v exekučnom titule:</xsl:text>
            <xsl:call-template name="booleanCheckboxToString">
                <xsl:with-param name="boolValue" select="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:IsLegalSuccessor" />
            </xsl:call-template>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:IsLegalSuccessorDetail">
            <xsl:call-template name="SekciaPodrobnosti_5"></xsl:call-template>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:ClaimOfBills/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
            <xsl:text>Nárok priznaný exekučným titulom vyplýva zo zmenky:</xsl:text>
            <xsl:call-template name="booleanCheckboxToString">
                <xsl:with-param name="boolValue" select="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:ClaimOfBills" />
            </xsl:call-template>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:ClaimOfBillsDetail">
            <xsl:call-template name="SekciaPodrobnosti_6"></xsl:call-template>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:OnEnforcementOfClaimsAreEligibleAlsoOtherAuthorized/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
            <xsl:text>Nárok je podmienený splnením podmienky alebo vzájomnej povinnosti oprávneným:</xsl:text>
            <xsl:call-template name="booleanCheckboxToString">
                <xsl:with-param name="boolValue" select="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:OnEnforcementOfClaimsAreEligibleAlsoOtherAuthorized" />
            </xsl:call-template>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:OnEnforcementOfClaimsAreEligibleAlsoOtherAuthorizedDetail">
            <xsl:call-template name="SekciaPodrobnosti_7"></xsl:call-template>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:PersonHavingFulfilledTheConditionOrMutualObligation/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
            <xsl:text>Návrhom na vykonanie exekúcie sa uplatňuje nárok zo spotrebiteľskej zmluvy:</xsl:text>
            <xsl:call-template name="booleanCheckboxToString">
                <xsl:with-param name="boolValue" select="/egonp:ProposalForExecution/egonp:StatementsAndProposal/egonp:PersonHavingFulfilledTheConditionOrMutualObligation" />
            </xsl:call-template>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
    </xsl:template>
    <xsl:template name="Isekcia_prilohySpr">
        <xsl:text>&#09;</xsl:text>
        <xsl:text>I) Prílohy uložené v OpP</xsl:text>
        <xsl:text>&#xA;</xsl:text>
        <xsl:if test="/egonp:ProposalForExecution/egonp:SPRAttachments/egonp:StoredInRegister/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
            <xsl:text>Uložené v správnom registri súdu (OpP):</xsl:text>
            <xsl:call-template name="booleanCheckboxToString">
                <xsl:with-param name="boolValue" select="/egonp:ProposalForExecution/egonp:SPRAttachments/egonp:StoredInRegister" />
            </xsl:call-template>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
        <xsl:for-each select="/egonp:ProposalForExecution/egonp:SPRAttachments/egonp:SPRAttachment">
            <xsl:call-template name="SekciaCisloSpr_1"></xsl:call-template>
        </xsl:for-each>
    </xsl:template>
    <xsl:template name="SekOznacenieMiesta">
        <xsl:text>&#09;</xsl:text>
        <xsl:text>J) Označenie miesta, dátumu a podávajúceho</xsl:text>
        <xsl:text>&#xA;</xsl:text>
        <xsl:if test="/egonp:ProposalForExecution/egonp:LabelingInformation/egonp:Place/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
            <xsl:text>V:</xsl:text>
            <xsl:value-of select="/egonp:ProposalForExecution/egonp:LabelingInformation/egonp:Place"/>
            <xsl:text>&#xA;</xsl:text>
        </xsl:if>
        <xsl:if test="/egonp:ProposalForExecution/egonp:LabelingInformation/egonp:Date/text()">
            <xsl:text>&#09;</xsl:text>
            <xsl:text>&#09;</xsl:text>
