															<fo:table-column />
															<fo:table-body>
																<fo:table-row>
																	<fo:table-cell>
																		<fo:block>
																			<xsl:choose>
																				<xsl:when test="/egonp:ProposalForExecution/egonp:EnforcementOfClaims/egonp:KindOfClaims/egonp:Codelist[egonp:CodelistCode='64']/egonp:CodelistItem/egonp:ItemCode[text()='NAROK_NEPENAZNY']">
